import React from "react";
import CustomizedCard from '../../atoms/CustomizedCard/CustomizedCard';
import ReceiptIcon from '@mui/icons-material/Receipt';
import AddReactionIcon from '@mui/icons-material/AddReaction';
import SummarizeIcon from '@mui/icons-material/Summarize';
import { useNavigate } from 'react-router-dom';
import '../../../Styles/style.css';

const NavigationTiles = ({
  viewreporteventclicked,
  addcustomereventclicked,
  generatereporteventclicked,
  generateinvoiceeventclicked
}) => {
  let navigate = useNavigate();
    return(
      <nav>
      <div class="container">
      <div class="row rowcontainer">
        <div class=" col-md-6 col-sm-6">
          {/* <Link to="/viewinvoice"> */}
        <CustomizedCard 
          // onClick={viewreporteventclicked}
          onClick={()=>{
            navigate('/viewinvoice')
          }}
          cardname={<ReceiptIcon className="navigationicon"/>} 
          cardlabel="View Invoice"
        />
        {/* </Link> */}
        </div>
        <div class="col-md-6 col-sm-6">
        {/* <Link to="/addcustomerpage"> */}
        <CustomizedCard 
        onClick={()=>{
          navigate('/addcustomerpage')
        }}
          // onClick={addcustomereventclicked}
          cardlabel="customer management"
          cardname={<AddReactionIcon className="navigationicon"/>} 
        />
        {/* </Link> */}
        </div>
        <div class="col-md-6 col-sm-6">
        {/* <Link to="/generateinvoice"> */}
        <CustomizedCard 
        onClick={()=>{
          navigate('/generateinvoice')
        }}
          // onClick={generateinvoiceeventclicked}
          cardlabel="generate invoice" 
          cardname={<ReceiptIcon className="navigationicon" />} 
        />
        {/* </Link> */}
        </div>
        <div class="col-md-6 col-sm-6">
        {/* <Link to="/generatereport"> */}
        <CustomizedCard 
        onClick={()=>{
          navigate('/generatereport')
        }}
          // onClick={generatereporteventclicked}
          cardlabel="generate report" 
          cardname={<SummarizeIcon className="navigationicon" />} 
        />
        {/* </Link> */}
        </div>
      </div>
    </div>
    </nav>
    );
}
export default NavigationTiles;
